import React, { useState } from "react";
import Icon from "react-native-vector-icons/AntDesign" 
import { SafeAreaView, View, Text, ScrollView, StyleSheet, TouchableOpacity, TextInput } from "react-native";
import {  
    FirstView3,
    BigText3,
    SecondView3,
    PhotoView,
    Quantity,
    QtyText,
    ButtonText
} from "../componenets/fintech4Style"


export default function Fintech4({navigation}){
    return(
        <SafeAreaView style={styles.fintech4container}>
            <ScrollView>
                <FirstView3>
                <TouchableOpacity style={styles.back2} onPress={()=>navigation.navigate("Fintech3")}>
                   <Icon size={20} color="#C3AD60" name="back" style={styles.pad3}/> 
                    </TouchableOpacity>
                   <BigText3 style={styles.pad3}>Procurement</BigText3>
                </FirstView3>
                <SecondView3>
                <PhotoView source={require('../../../../assets/pro.png')}>
                    <Quantity><QtyText>Qty: 1</QtyText><Icon name="caretdown" size={6} color="#fff"/></Quantity>
                </PhotoView>
                <TouchableOpacity style={styles.btn5} onPress={()=>navigation.navigate("Fintech7")}>
                    <ButtonText>Submit</ButtonText>
                </TouchableOpacity>
                </SecondView3>
            </ScrollView>
        </SafeAreaView>


)}

const styles = StyleSheet.create({
    fintech4container: {
        backgroundColor: "#000",
        paddingTop: 25,
        flex: 1,
    },
    back2: {
        padding: 10,
    },
    pad3: {
        paddingLeft: 40,
    },
    btn5: {
        height: 48,
        width: 340,
        borderRadius: 100,
        backgroundColor: "#C3AD60",
        marginTop: 270,
        alignItems: "center",
        justifyContent: "center",
    }
});
